import React, { useState, useEffect } from 'react';
import { Row, Col, Card, Button, Spinner } from 'react-bootstrap';

function Products() {
  const [products, setProducts] = useState([]);

  // Dummy data
  useEffect(() => {
    const dummyProducts = [
      {
        id: 1,
        name: 'Kue Lapis Tradisional',
        description: 'Kue lapis spesial dari resep warisan keluarga',
        price: 50000,
        image: 'https://via.placeholder.com/300x200'
      },
      {
        id: 2,
        name: 'Dodol Nusantara',
        description: 'Dodol berkualitas premium dari berbagai daerah',
        price: 75000,
        image: 'https://via.placeholder.com/300x200'
      }
    ];

    setProducts(dummyProducts);
  }, []);

  return (
    <div className="products-page">
      <h1 className="text-center mb-4">Produk Kami</h1>
      <Row>
        {products.map(product => (
          <Col key={product.id} md={4} className="mb-4">
            <Card>
              <Card.Img variant="top" src={product.image} />
              <Card.Body>
                <Card.Title>{product.name}</Card.Title>
                <Card.Text>{product.description}</Card.Text>
                <Card.Text>
                  <strong>Harga: Rp {product.price.toLocaleString()}</strong>
                </Card.Text>
                <Button variant="primary">Beli Sekarang</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </div>
  );
}

export default Products;
